import OrbitControls from '../Utils/OrbitControls';
import Container from 'Container';
import { Events } from 'helpers';

/**
 * Camera class
 */
class Camera extends THREE.PerspectiveCamera {

  /**
   * Constructor function
   * @param  {object} configuration Configuration
   * @return {void}
   */
  constructor( configuration ) {

    const { fov, aspect, near, far, position, target, orbitControls } = configuration.get('camera');

    super( fov, aspect, near, far );
    this.position.set( position.x, position.y, position.z );
    this.lookAt(target);

    if( orbitControls ) {
      this.controls = new OrbitControls( this, Container.get('Configuration').get('canvas') );
    }

    this.bindEvents();
  }

  /**
   * BindEvents function
   * @return {void}
   */
  bindEvents() {
    Events.on( 'resize', ::this.resize );
  }

  /**
   * Resize function
   * @param  {integer} width  Width
   * @param  {integer} height Height
   * @return {void}
   */
  resize( width, height ) {
    this.aspect = width / height;
    this.updateProjectionMatrix();
  }
}

export default Camera;

import { Events } from 'helpers';

/**
 * Renderer class
 */
class Renderer extends THREE.WebGLRenderer {

  /**
   * Constructor function
   * @param  {object} options Options
   * @return {void}
   */
  constructor( options = { antialias: true, alpha: true } ) {
    super( options );

    this.setSize( window.innerWidth, window.innerHeight );
    this.setClearColor( 0x000000 );
    this.setPixelRatio( window.devicePixelRatio );
    this.clear();

    // Gamma 2.2 / Linear workflow
    this.gammaInput = true;
    this.gammaOutput = true;

    // Resize listener
    Events.on( 'resize', ::this.resize );
  }

  /**
   * Resize function
   * @param  {integer} width  Width
   * @param  {integer} height Height
   * @return {void}
   */
