var window = require('global/window');

// <filename, materialList> cache
// Stores all materials created by a hot module.
module.exports.cache = function (filename) {
  var cache;
  if (window.__hmrShaderCache) {
    cache = window.__hmrShaderCache;
  } else {
    cache = {};
    Object.defineProperty(window, '__hmrShaderCache', {
      configurable: true,
      enumerable: false,
      writable: false,
      value: cache
    });
  }
  if (!cache[filename]) {
    cache[filename] = {};
  }
  return cache[filename];
};

// Enables HMR on the given material
module.exports.enable = enable;
function enable (cache, material) {
  var uuid = material.uuid;
  if (cache[uuid]) {
    throw new Error('This material already has HMR set.');
  }

  cache[uuid] = material;

  var oldDispose = material.dispose;
  material.dispose = function () {
    if (cache[uuid]) delete cache[uuid];
    return oldDispose.call(material);
  };

  var oldClone = material.clone;
  material.clone = function () {
    var newObj = oldClone.call(material);
    enable(cache, newObj);
    return newObj;
  };
}

module.exports.update = function (cache, opt) {
  /*eslint-disable no-console */
  console.log('[ThreeJS]', 'Patching shaders');
  /*eslint-enable no-console */
  Object.keys(cache).forEach(uuid => {
    var material = cache[uuid];
    if (!material) return;
    material.setValues(opt);
    material.needsUpdate = true;
  });
};

import { Events } from 'helpers';

/**
 * TextureLoader class
 */
class TextureLoader extends THREE.TextureLoader {

  /**
   * Constructor function
   * @param  {object} textures
   * @return {void}
   */
  constructor( configuration ) {
    super();

    this.textures = configuration.get( 'textures' );
    this.promises = [];
    this.loadedTextures = [];
    this.numberTextures = Object.keys( this.textures ).length;
    this.counter = 0;

    for( let t in this.textures ) {
      const url = this.textures[ t ];

      const promise = new Promise(( resolve, reject ) => {
        this.load(
          url,
          texture => {
            texture.name = t;
            this.counter++;
            Events.emit( 'textureLoader:loading', this.counter, this.numberTextures );

            resolve( texture );
          },
          () => null,
          () => reject
        );
      });

      this.promises.push( promise );
    }
  }

  /**
   * Init function
   * @return {object} Promise
   */
  init() {
    return Promise.all( this.promises ).then( textures => this.loadedTextures = textures );
  }

  /**
   * Get function
   * @param  {string} texture Texture name
   * @return {object}         Texture
   */
  get( texture ) {
    return this.loadedTextures.find( i => i.name == texture );
  }
}

export default TextureLoader;

