/**
 * Linear interpolation between two values (lerping)
 *
 * @param  {number} x First point
 * @param  {number} y Second point
 * @param  {number} r Value to interpolate
 * @return {number}   Lerped value
 */
export default function lerp(x, y, r) {
  return x + ((y - x) * r);
}

/**
 * Lighten or darken a color
 *
 * @param  {string} col Color
 * @param  {number} amt Amount
 * @return {string}     Computed hexadecimal
 */
export default function lightenDarkenColor(col, amt) {

  var usePound = false;

  if (col[0] == "#") {
    col = col.slice(1);
    usePound = true;
  }

  var num = parseInt(col,16);

  var r = (num >> 16) + amt;

  if (r > 255) r = 255;
  else if  (r < 0) r = 0;

  var b = ((num >> 8) & 0x00FF) + amt;

  if (b > 255) b = 255;
  else if  (b < 0) b = 0;

  var g = (num & 0x0000FF) + amt;

  if (g > 255) g = 255;
  else if (g < 0) g = 0;

  return (usePound?"#":"") + (g | (b << 8) | (r << 16)).toString(16);
};

/**
 * Loop on an index value
 *
 * @param  {number} index  Index
 * @param  {number} length Length
 * @return {number}        Looped index
 */
export default function loopIndex(index, length) {
  if (index < 0) {
    index = length + index % length;
  }
  if (index >= length) {
    return index % length;
  }
  return index;
};

/**
 * Re-maps a number from one range to another
 *
 * @param  {number} value  The incoming value to be converted
 * @param  {number} start1 Lower bound of the value's current range
 * @param  {number} stop1  Upper bound of the value's current range
 * @param  {number} start2 Lower bound of the value's target range
 * @param  {number} stop2  Upper bound of the value's target range
 * @return {number}        Remapped number
 */
export default function map(value, start1, stop1, start2, stop2) {
  return ((value - start1) / (stop1 - start1)) * (stop2 - start2) + start2;
}

/**
 * Normalize a value between two bounds
 *
 * @param  {number} min Minimum boundary
 * @param  {number} max Maximum boundary
 * @param  {number} x   Value to normalize
 * @return {number}     Normalized value
 */
export default function normalize(min, max, x) {
  return (x - min) / (max - min);
}

/**
 * Remap the 0..1 interval into 0..1 parabola, such that the corners are remaped to 0 and the center to 1.
 * In other words, parabola(0) = parabola(1) = 0, and parabola(1/2) = 1.
 *
 * @param  {number} k Value to map
 * @param  {number} x Coordinate on X axis
 * @return {number}   Mapped value
 */
export default function parabola(k, x) {
  return Math.pow( 4 * x * ( 1 - x ), k );
}

/**
 * Generate a random float
 *
 * @param  {number} minValue  Minimum boundary
 * @param  {number} maxValue  Maximum boundary
 * @param  {number} precision Precision
 * @return {number}           Generated float
 */
export default function randomFloat( minValue, maxValue, precision = 2 ) {
  return parseFloat( Math.min( minValue + ( Math.random() * ( maxValue - minValue ) ), maxValue ).toFixed( precision ) );
}

/**
 * Generate a random hexadecimal color
 *
 * @return {string} Hexadecimal color
 */
export default function randomHexColor() {
  return '#' + Math.floor( Math.random() * 16777215 ).toString( 16 );
}

/**
 * Generate a random integer
 *
 * @param  {number} min Minimum boundary
 * @param  {number} max Maximum boundary
 * @return {number}     Generated integer
 */
export default function randomInt(min, max) {
  return Math.floor( Math.random() * ( max - min + 1 ) + min );
}

/**
 * Smooth a value
 *
 * @param  {number} min Minimum boundary
 * @param  {number} max Maximum boundary
 * @param  {number} v   Value
 * @return {number}     Smoothed value
 */
export default function smoothStep(min, max, v) {
  const x = Math.max( 0, Math.min( 1, ( v - min ) / ( max - min ) ) );
  return x * x * ( 3 - 2 * x );
};

/**
 * Get the type of an object
 *
 * @param  {object} obj Object
 * @return {string}     Type of the object
 */
export default function toType(obj) {
  return ({}).toString.call(obj).match(/\s([a-zA-Z]+)/)[1].toLowerCase();
}
